package com.hackathon.clarifai;import com.clarifai.api.ClarifaiClient;import com.clarifai.api.RecognitionRequest;import com.clarifai.api.RecognitionResult;import com.clarifai.api.Tag;import java.util.List;public class Sandbox {    private static ClarifaiClient getClarifyClient(){        return new ClarifaiClient("rt-Oyb7F9RkyBvD3lI8f6Aii9bnfqbSb7h8dukWl", "xMTCgr9SY7FtDUBMtHWomfkorfmTR-ircVTORCdE");    }    public static List<Tag> getListOfTags(String foodUrl) {        ClarifaiClient clarifai = getClarifyClient();        RecognitionRequest  recognitionRequest = new RecognitionRequest(foodUrl);        recognitionRequest.setModel("food-items-v0.1");        List<RecognitionResult> results = clarifai.recognize(recognitionRequest);        for (int i = 0; i < results.size(); i++) {            RecognitionResult result = results.get(i);            System.out.println("\nResult  : " + result.getStatusCode());            if (result.getStatusCode() == RecognitionResult.StatusCode.OK) {                return printTags(result.getTags());            } else {                System.out.println("  Failed: " + result.getStatusMessage());            }        }        return null;    }    private static List<Tag> printTags(List<Tag> tags) {        for (Tag tag : tags) {             System.out.println(String.format("  %s (%.4f)", tag.getName(), tag.getProbability()));        }        return tags;    }}